import React from "react";

function Users() {
  return (
    <div className="container d-flex" style={{ justifyContent: "center" }}>
      <div className="" style={{ fontSize: "30px" }}>
        We
      </div>
      <br />
      <div className="" style={{ fontSize: "30px" }}>
        LOVE
      </div>
    </div>
  );
}

export default Users;
